      <footer className="py-5 bg-dark">
        <div className="container">
          <p className="m-0 text-center text-white">
            {/* TODO: contacts */}
            {/* TODO: address */}
            {/* TODO: land acknowledgement */}
            {/* TODO: OCF mark */}
            Copyright &copy; Society of Women Engineers 2023
          </p>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
